C-{{{ subroutine G^2l_lf
      
      subroutine G2llf(mhiggs, G2out)
!--------------------------------------------------------
!This routine calculates G^2l_lf for the electroweak
!contributions of light fermions to gluon fusion using
!the complex mass scheme in accordance to
!hep-ph/0404071 and 1007.1891.
!Note that for the electroweak corrections
!we use fixed values of m_W and m_Z, namely:
!m_W = 80.385GeV
!m_Z = 91.1876GeV
!Gamma_W = 2.085GeV
!Gamma_Z = 2.4952GeV
!--------------------------------------------------------
!Additional external factors:
!Prefactor
! alpha_EM / (2 Pi s_W^2) (m_W - i Gamma_W/2)^2/m_H^2!
!MSSM factors
! cos(beta-alpha) for H / sin(beta-alpha) for h
!Be aware of the normalization of the gluon fuson LO
!amplitude, in our case to be multiplied with -3/4.D0!
!--------------------------------------------------------
!October 2012 - S. Liebler
!--------------------------------------------------------
      implicit none
      double precision mhiggs
      double complex G2out

      double precision costhetaW, sinthetaW
      double precision ReA1MW, ImA1MW, ReA1MZ, ImA1MZ
      double precision prefacz, prefacw
      double precision ReG2, ImG2

      call CalcA1MW(mhiggs, ReA1MW, ImA1MW)
      call CalcA1MZ(mhiggs, ReA1MZ, ImA1MZ)

      sinthetaW = sqrt(0.22295D0) !value from PDG 2012
      costhetaW = sqrt(1.D0 - sinthetaW**2)

      prefacz = 2.D0/costhetaW**4 * (5/4.D0 
     &     - 7/3.D0 * sinthetaW**2 + 22/9.D0 * sinthetaW**4)

      prefacw = 4.D0

      ReG2 = prefacz * ReA1MZ + prefacw * ReA1MW
      ImG2 = prefacz * ImA1MZ + prefacw * ImA1MW

      G2out = (1D0,0D0)*ReG2 + (0D0,1D0)*ImG2

      end

C-}}}
